import styled from 'styled-components';

export const StyledNav = styled.nav`
  display: flex;
  align-items: center;
  justify-content: space-between;
  background: #141414;

  color: #e5e5e5;
  font-size: 14px;

  padding: 20px 50px;

  div {
    img {
      height: 25px;
    }
  }
`;

export const NavLeft = styled.div`
  display: flex;
  align-items: center;
`;
